@ryuuseipro The special effects were originally handled by Yoshiyuki Kuroda, the director of "Daimajin." 

His visa expired and he was replaced by Director Arikawa, but some of Kuroda's footage was used. 

I think this film is the pinnacle of Director Arikawa's special effects. https://t.co/P7gYoBfDrJ
